import React from "react";

const AddContact = () => {
  return (
    <div>
      <h2>Add Contact</h2>
      <form>
        <div>
          <label>Name</label>
          <input type="text" name="name" placeholder="Name" />
        </div>
      </form>
    </div>
  );
};

export default AddContact;
